const i=e=>({INTP:{color:"#8f4aaf",mainBody:{tags:["Introverted","Intuitive","Thinking","Prospecting"],title:"Logician",type:"INTP",description:"Logicians are flexible thinkers who enjoy taking unconventional approaches and exploring creative ideas."},content:[{title:"Introduction",contentBlocks:[{type:"quote",text:"The important thing is not to stop questioning. Curiosity has its own reason for existence.",author:"Albert Einstein"},{type:"description",text:"People with the INTP personality type (Logicians) pride themselves on their unique perspective and vigorous intellect. They can’t help but puzzle over the mysteries of the universe – which may explain why some of the most influential philosophers and scientists of all time have been INTPs. People with this personality type tend to prefer solitude, as they can easily become immersed in their thoughts when they are left to their own devices. They are also incredibly creative and inventive, and they are not afraid to express their novel ways of thinking or to stand out from the crowd."},{type:"hr"},{type:"description",text:"INTPs cherish their independence and often find themselves most productive during the late evening hours when distractions are kept to a minimum. Even so, it would be a mistake to think that these personalities are unfriendly or uptight. When they connect with someone who can match their mental energy, INTPs absolutely light up, leaping from one thought to another. Few things energize them like the opportunity to swap ideas or enjoy a lively debate with another curious, inquiring soul."}]},{title:"The Life of the Mind",contentBlocks:[{type:"description",text:"INTP personalities often lose themselves in thought – which isn’t necessarily a bad thing. People with this personality type hardly ever stop thinking. From the moment they wake up, their mind buzzes with ideas, questions, and insights. At times, they may even find themselves conducting full-fledged debates in their own heads. And it’s not uncommon for them to drift off during conversations. Their mind simply executes a detour to uncharted territories of thought where new ideas are constantly being born."},{type:"explanatory_note",text:"Imaginative and curious, people with the INTP personality type can find endless fascination in the workings of their own mind."},{type:"description",text:"From the outside, INTPs may seem to live in a never-ending daydream. They have a reputation for being pensive, detached, and a bit reserved. That is, until they actively try to direct all of their mental energy on the moment or the person at hand. But regardless of which mode they’re in, INTPs are Introverts and tend to get tired out by extensive socializing. After a long day, they crave time alone to consult their own thoughts."}]},{title:"Elementary, My Dear Logician",contentBlocks:[{type:"description",text:"People with the INTP personality type love to analyze patterns. Without necessarily knowing how they do it, they often have a Sherlock Holmes-like knack for spotting discrepancies and irregularities. In other words, it might be a bad idea to lie to someone with this type."},{type:"description",text:"For people with the INTP personality type, the best conversations are like brainstorming sessions, with plenty of room for unconventional thoughts and off-the-wall what-ifs. INTPs could spend all day musing about ideas and possibilities – and they often do. That said, the practical, everyday work of turning those ideas into reality doesn’t always hold their interest. Fortunately, when it comes to dissecting a tricky, multilayered problem and coming up with a creative solution, few personality types can match INTPs’ creative genius and potential."}]},{title:"Mysteries of the Universe",contentBlocks:[{type:"description",text:"People with this personality type want to understand everything in the universe, but one area in particular tends to mystify them: human nature. As their name suggests, INTPs (a.k.a Logicians) feel most at home in the realm of logic and rationality. As a result, they can find themselves baffled by the illogical, irrational ways that feelings and emotions influence people’s behavior – including their own."},{type:"description",text:"This “analysis paralysis” can affect multiple areas of INTPs’ lives. People with this personality type can overthink even the smallest of decisions. This sometimes makes them feel ineffective and stuck, so exhausted by the endless parade of thoughts in their mind that they struggle to get things done."},{type:"description",text:"The good news is that they don’t have to stay stuck for long. Their unique strengths include everything that they need to pull themselves out of the ruts that they occasionally fall into. By leveraging their creativity and their open-mindedness, people with the INTP personality type can reach their full potential – both as thinkers and as happy, well-rounded people."}]}]},INTJ:{color:"#8f4aaf",mainBody:{tags:["Introverted","Intuitive","Thinking","Judging"],title:"Architect",type:"INTJ",description:"Architects are thoughtful tacticians who love perfecting the details of life and applying creativity and rationality to everything they do."},content:[{title:"Introduction",contentBlocks:[{type:"quote",text:"Thought constitutes the greatness of man. Man is a reed, the feeblest thing in nature, but he is a thinking reed.",author:"Blaise Pascal"},{type:"description",text:"People with the INTJ personality type (Architects) are intellectually curious individuals with a deep-seated thirst for knowledge. INTJs tend to value creative ingenuity, straightforward rationality, and self-improvement. They consistently work toward enhancing intellectual abilities and are often driven by an intense desire to master any and every topic that piques their interest."},{type:"hr"},{type:"description",text:"Logical and quick-witted, INTJs pride themselves on their ability to think for themselves, not to mention their uncanny knack for seeing right through phoniness and hypocrisy. Because their minds are never at rest, these personalities may sometimes struggle to find people who can keep up with their nonstop analysis of everything around them. But when they do find like-minded individuals who appreciate their intensity and depth of thought, INTJs form profound and intellectually stimulating relationships that they deeply treasure."}]},{title:"A Pioneering Spirit",contentBlocks:[{type:"description",text:"INTJs question most things, basing their beliefs on solid evidence, reasoning, and rationality. Many personality types trust the status quo, relying on conventional wisdom and other people’s expertise to guide their lives. But ever-skeptical INTJ personalities prefer to make their own discoveries. In their quest to find better ways of doing things, they aren’t afraid to break the rules or risk disapproval – in fact, they often rather enjoy it."},{type:"description",text:"People with the INTJ personality type, independent to the core, want to shake off other people’s expectations and pursue their own ideas. At times, this lone-wolf behavior can come across as insensitive, as it fails to take into consideration others’ thoughts, desires, and plans."},{type:"description",text:"It would be a mistake, however, to view INTJ personalities as uncaring. Whatever the stereotypes about their stoic intellect, they feel deeply. When things go wrong or when they hurt others, they are personally affected and spend much time and energy trying to figure out why things happened the way that they did."}]},{title:"A Thirst for Knowledge",contentBlocks:[{type:"description",text:"INTJs can be both the boldest of dreamers and the bitterest of pessimists. They believe that, through willpower and intelligence, they can achieve even the most challenging goals. They are firm believers that taking the easy way out in any given situation prevents people from achieving greatness. But these personalities may be cynical about human nature more generally, assuming that most people are lazy, unimaginative, or simply doomed to mediocrity."},{type:"description",text:"People with the INTJ personality type derive much of their self-esteem from their knowledge and mental acuity. They don’t just learn new things for show – they genuinely enjoy expanding the limits of their knowledge."},{type:"description",text:"In their seemingly constant pursuit of knowledge, people with this personality type can sometimes be single-minded, with little patience for frivolity, distractions, or idle gossip. Many INTJ personalities are known for their irreverent wit, and beneath their serious exteriors, they often have a sharp, delightfully sarcastic sense of humor."}]},{title:"Social Frustrations",contentBlocks:[{type:"description",text:"INTJs aren’t known for being warm and fuzzy. They tend to prioritize rationality and success over politeness and pleasantries – in other words, they’d rather be right than popular. And because these personalities value truth and depth, many common social practices – from small talk to white lies – may seem pointless or downright stupid to them."},{type:"description",text:"But like any personality type, INTJs do crave social interaction – they’d just prefer to surround themselves with people who share their values and priorities. When they pursue their interests, their authenticity can draw people to them – professionally, socially, and even romantically."}]},{title:"The Chess Game of Life",contentBlocks:[{type:"description",text:"People with the INTJ personality type are full of contradictions. They are imaginative yet decisive, ambitious yet private, and curious yet focused. For these personalities, life is like a giant game of chess. Relying on strategy rather than chance, INTJs contemplate the strengths and weaknesses of each move before they make it. And they never lose faith that, with enough ingenuity and insight, they can find a way to win – no matter what challenges might arise along the way."}]}]},ENTJ:{color:"#8f4aaf",mainBody:{tags:["Extraverted","Intuitive","Thinking","Judging"],title:"Commander",type:"ENTJ",description:"Commanders are decisive and love momentum and accomplishment, combining charisma, confidence, and sharp minds to achieve their goals."},content:[{title:"Introduction",contentBlocks:[{type:"quote",text:"Your time is limited, so don’t waste it living someone else’s life.",author:"Steve Jobs"},{type:"description",text:"People with the ENTJ personality type (Commanders) are natural-born leaders. Embodying the gifts of charisma and confidence, ENTJs project authority in a way that draws crowds together behind a common goal. However, these personalities are also characterized by an often ruthless level of rationality, using their drive, determination, and sharp mind to achieve whatever objectives they’ve set for themselves. Their intensity might sometimes rub people the wrong way, but ultimately, ENTJs take pride in both their work ethic and their impressive level of self-discipline."},{type:"hr"},{type:"description",text:"ENTJ personalities perceive themselves to be a strong positive influence on others."}]},{title:"Striving for Greatness",contentBlocks:[{type:"description",text:"If there’s anything that people with this personality type love, it’s a good challenge, big or small, and they firmly believe that, given enough time and resources, they can achieve any goal. This quality makes ENTJs brilliant entrepreneurs, and their ability to think strategically and hold a long-term focus while executing each step of their plans with determination and precision makes them powerful business leaders."},{type:"description",text:"This determination is often a self-fulfilling prophecy, as ENTJ personalities push their goals through with sheer willpower where others might give up and move on, and they are likely to push everyone else right along with them, achieving spectacular results in the process."},{type:"description",text:"At the negotiating table, be it in a corporate environment or buying a car, ENTJs are dominant, unforgiving, and unyielding. This isn’t because they are coldhearted or vicious per se – it’s more that these personalities genuinely enjoy the challenge, the battle of wits, and the repartee that comes from this environment. If the other side can’t keep up, that’s no reason for them to fold on their own core tenet of ultimate victory."},{type:"explanatory_note",text:'The underlying thought running through an ENTJ’s mind might be: "I don’t care if you call me an insensitive b*****d, as long as I remain an efficient b*****d."'}]},{title:"A Worthy Challenge",contentBlocks:[{type:"description",text:"Emotional expression isn’t the strong suit of any Analyst (NT) type, but ENTJs’ distance from their emotions is especially public and felt directly by a much broader swath of people. Especially in a professional environment, these personalities may inadvertently overlook the emotional sensitivity of individuals who they perceive as inefficient or lazy."},{type:"description",text:"ENTJ personalities are true powerhouses, and they cultivate an image of being larger than life – and often enough they are. They need to remember, though, that their stature comes not just from their own actions but from the actions of the team that props them up. It’s important for them to recognize the contributions, talents, and needs of their support network – especially from an emotional standpoint."},{type:"description",text:"Even if they have to adopt a “fake it ‘til you make it” mentality, if people with the ENTJ personality type are able to combine an emotionally healthy focus alongside their many strengths, they will be rewarded with deep, satisfying relationships and all the challenging victories that they can handle."}]}]},ENTP:{color:"#8f4aaf",mainBody:{tags:["Extraverted","Intuitive","Thinking","Prospecting"],title:"Debater",type:"ENTP",description:"Debaters are bold and creative thinkers, deconstructing and rebuilding ideas with great mental agility, vigorously pursuing their goals despite resistance."},content:[{title:"Introduction",contentBlocks:[{type:"description",text:"Quick-witted and audacious, people with the ENTP personality type (Debaters) aren’t afraid to disagree with the status quo. In fact, they’re not afraid to disagree with pretty much anything or anyone. Few things light up these personalities more than a bit of verbal sparring – and if the conversation veers into controversial terrain, so much the better."},{type:"hr"},{type:"description",text:"It would be a mistake, though, to think of ENTPs as disagreeable or mean-spirited. Instead, people with this personality type are knowledgeable and curious with a playful sense of humor, and they can be incredibly entertaining. They simply have an offbeat, contrarian idea of fun – one that usually involves a healthy dose of spirited debate."},{type:"description",text:"ENTP personalities are the ultimate devil’s advocates, thriving on the process of shredding people’s arguments to pieces. Sometimes they even rebel against their own beliefs by arguing the opposing viewpoint – just to see how the world looks from the other side."}]},{title:"Breaking the Rules",contentBlocks:[{type:"quote",text:"Follow the path of the unsafe, independent thinker. Expose your ideas to the dangers of controversy.",author:"Thomas J. Watson"},{type:"description",text:"ENTPs are known for their rebellious streak. For this personality type, no belief is too sacred to be questioned, no idea is too fundamental to be scrutinized, and no rule is too important to be broken or at least thoroughly tested. This may make ENTP personalities seem overly cavalier or defiant, but at their core, their innate tendency to test boundaries has more to do with their desire for innovation and change."},{type:"description",text:"As they see it, most people are too ready to do as they’re told and blindly conform to social norms, pressures, and standards. ENTP personalities enjoy the mental exercise of questioning the prevailing mode of thought, and they take a certain pleasure in uncovering the value of underdogs and outliers."},{type:"description",text:"For many people with the ENTP personality type, one of life’s greatest challenges is to translate their wide-ranging intellectual energy into real-world achievements and contributions. While ENTPs love to brainstorm and think big, these personalities tend to avoid getting caught doing the “grunt work” of implementing their ideas, and they sometimes have a hard time sticking to their goals."}]},{title:"The Cost of Contrarianism",contentBlocks:[{type:"description",text:"ENTPs’ capacity for debate is legendary, but that doesn’t mean that it’s always helpful. When they openly question their boss in a meeting or pick apart everything that their significant other says, these sharp personalities may think they’re being champions of rationality and logic. But they may also be doing their chances of success and happiness more harm than good."},{type:"description",text:"Not every occasion calls for this personality type’s default contrarianism, and most people can only stand to have their beliefs questioned and their feelings brushed aside for so long. As a result, ENTPs may find that their quarrelsome fun burns many bridges, often inadvertently."},{type:"description",text:"With time, many ENTP personalities realize that their ideal life involves other people and that spending too much energy on “winning” arguments ultimately means robbing themselves of the support that they need to get where they want to be in life. The good news is that people with this personality type will never lose their sharply nonconformist edge. They can simply use their cognitive flexibility to understand and explore others’ perspectives, recognizing the value of consideration and compromise alongside logic and progress."}]}]},ENFJ:{color:"#58a474",mainBody:{tags:["Extraverted","Intuitive","Feeling","Judging"],title:"Protagonist",type:"ENFJ",description:"Protagonists are warm and forthright individuals who love helping others. With strong ideas and values, they back their perspective with creative energy to achieve their goals."},content:[{title:"Introduction",contentBlocks:[{type:"quote",text:"When the whole world is silent, even one voice becomes powerful.",author:"Malala Yousafzai"},{type:"description",text:"People with the ENFJ personality type (Protagonists) feel called to serve a greater purpose in life. Thoughtful and idealistic, ENFJs strive to have a positive impact on other people and the world around them. These personalities rarely shy away from an opportunity to do the right thing, even when doing so is far from easy."},{type:"description",text:"ENFJs are born leaders, which explains why these personalities can be found among many notable politicians, coaches, and teachers. Their passion and charisma allow them to inspire others not just in their careers but in every arena of their lives, including their relationships. Few things bring people with the ENFJ personality type a deeper sense of joy and fulfillment than guiding friends and loved ones to grow into their best selves."},{type:"explanatory_note",text:"ENFJs possess the unique ability to remain hopeful in the face of difficulties, always remembering that there is something to be grateful for."}]},{title:"Speaking Up for What’s Right",contentBlocks:[{type:"description",text:"ENFJs tend to be vocal about their values, including authenticity and altruism. When something strikes them as unjust or wrong, they speak up. But they rarely come across as brash or pushy, as their sensitivity and insight guide them to speak in ways that resonate with others."},{type:"description",text:"ENFJ personalities have not only an uncanny ability to pick up on people’s underlying motivations and beliefs but also a knack for understanding how others are feeling just by looking at them. At times, they may not even understand how they come to grasp another person’s mind and heart so quickly. These flashes of insight can make ENFJs incredibly persuasive and inspiring communicators."},{type:"description",text:"This personality type’s secret weapon is their purity of intent. Generally speaking, ENFJs are motivated by a sincere wish to do the right thing rather than a desire to manipulate or have power over other people. The result is that people with the ENFJ personality type can communicate with an eloquence and sensitivity that are nearly impossible to ignore – particularly when they speak about matters that are close to their hearts."}]},{title:"Getting Involved",contentBlocks:[{type:"description",text:"ENFJ personalities are genuine, caring people who talk the talk and walk the walk. Nothing makes them happier than motivating others to do what’s right."},{type:"description",text:"When ENFJs care about someone, they want to help solve that person’s problems – sometimes at any cost. The good news is that many people are grateful for this assistance and advice. However, ENFJs may sometimes push too hard, leaving their loved ones feeling resentful or unfairly judged."},{type:"description",text:"Even the wisest ENFJs may sometimes misread a situation or unwittingly give bad advice. While they have a clear vision of what people can or should do to improve themselves, not everyone is ready to make those changes."}]},{title:"Leading the Way",contentBlocks:[{type:"description",text:"People with this personality type are devoted altruists, ready to face slings and arrows in order to stand up for the people and ideas that they believe in. This strength of conviction bolsters an ENFJ’s ability to guide others to work together in service of the greater good."},{type:"description",text:"But their greatest gift might actually be leading by example. In their day-to-day lives, ENFJs reveal how seemingly ordinary situations can be handled with compassion, dedication, and care. For these personalities, even the smallest daily choices and actions – from how they spend their weekend to what they say to a coworker who is struggling – can become an opportunity to lead the way to a brighter future."}]}]},ENFP:{color:"#58a474",mainBody:{tags:["Extraverted","Intuitive","Feeling","Prospecting"],title:"Campaigner",type:"ENFP",description:"Campaigners are outgoing, openhearted, and open-minded individuals who embrace big ideas and actions with vibrant energy and hope for the world."},content:[{title:"Introduction",contentBlocks:[{type:"quote",text:"It doesn’t interest me what you do for a living. I want to know what you ache for – and if you dare to dream of meeting your heart’s longing.",author:"Oriah Mountain Dreamer"},{type:"description",text:"People with the ENFP personality type (Campaigners) are true free spirits – outgoing, openhearted, and open-minded. With their lively, upbeat approach to life, ENFPs stand out in any crowd. But even though they can be the life of the party, they don’t just care about having a good time. These personalities have profound depths that are fueled by their intense desire for meaningful, emotional connections with others."}]},{title:"The Magic of Everyday Life",contentBlocks:[{type:"description",text:"ENFP personalities carry an interesting blend of carefree sociability, sparkling imagination, and deep, contemplative introspection. They regularly use their natural curiosity and expansive creativity to try to better understand themselves and the complex dynamics of human relationships. And they are truly devoted to nurturing their relationships with and their understanding of the world at large."},{type:"description",text:"In their unique way, ENFPs’ introspective nature is driven by their imagination, wonder, and belief in things that cannot always be explained rationally. People with this personality type truly believe that everything – and everyone – is connected, and they live for the glimmers of insight that they can gain from these connections. They believe that how we treat one another really matters. In fact, ENFPs are the most likely personality type to believe in the concept of karma."},{type:"description",text:"When something sparks their imagination, ENFPs show an enthusiasm that is nothing short of infectious. These personalities can’t help but to radiate a positive energy that draws other people in. However, once their initial bloom of inspiration wears off, ENFPs can struggle with self-discipline and consistency, losing steam on projects that once meant so much to them."}]},{title:"Seeking Joy",contentBlocks:[{type:"description",text:"ENFP personalities are proof that seeking out life’s joys and pleasures isn’t the same as being shallow. Seemingly in the blink of an eye, people with this personality type can transform from impassioned idealists to carefree figures on the dance floor."},{type:"description",text:"Even in moments of fun, ENFPs want to connect emotionally with others. Few things matter more to these personalities than having genuine, heartfelt conversations with the people they cherish. ENFPs believe that everyone deserves to express their feelings, and their empathy and warmth create spaces where even the most timid spirits can feel comfortable opening up."},{type:"description",text:"ENFPs need to be careful, however. Their intuition may lead them to read far too much into other people’s actions and behaviors. Instead of simply asking for an explanation, they may end up puzzling over someone else’s desires or intentions. This kind of social stress is what keeps harmony-focused ENFP personalities awake at night."},{type:"description",text:"ENFPs will spend a lot of time exploring different relationships, feelings, and ideas before they find a path for their life that feels right. But when they do finally find their way, their imagination, empathy, and courage can light up not only their own life but also the world around them."}]}]},INFJ:{color:"#58a474",mainBody:{tags:["Introverted","Intuitive","Feeling","Judging"],title:"Advocate",type:"INFJ",description:"Advocates are thoughtful and imaginative individuals, guided by their inner vision, personal values, and a quiet sense of humanism."},content:[{title:"Introduction",contentBlocks:[{type:"quote",text:"Treat people as if they were what they ought to be and you help them to become what they are capable of being.",author:"Johann Wolfgang Von Goethe"},{type:"description",text:"Idealistic and principled, people with the INFJ personality type (Advocates) aren’t content to coast through life – they want to stand up and make a difference. For these compassionate personalities, success doesn’t come from money or status but from seeking fulfillment, helping others, and being a force for good in the world."},{type:"description",text:"While they have lofty goals and ambitions, INFJs shouldn’t be mistaken for idle dreamers. People with this personality type care about integrity, and they’re rarely satisfied until they’ve done what they know to be right. Conscientious to the core, they move through life with a clear sense of their values, and they aim to never lose sight of what truly matters – not according to other people or society at large but according to their own wisdom and intuition."}]},{title:"Seeking Purpose",contentBlocks:[{type:"description",text:"Perhaps because their personality type is so uncommon, INFJs tend to carry around a sense – whether conscious or not – of being different from most people. With their rich inner lives and their deep, abiding desire to find their life purpose, they don’t always fit in with those around them. This isn’t to say that INFJ personalities can’t enjoy social acceptance or close relationships – only that they sometimes feel misunderstood or at odds with the world."},{type:"description",text:"Fortunately, this sense of being out of step doesn’t diminish INFJs’ commitment to making the world a better place. These personalities are troubled by injustice, and they typically care more about altruism than personal gain. They often feel called to use their strengths – including creativity, imagination, and sensitivity – to uplift others and spread compassion."},{type:"explanatory_note",text:"Nothing lights up an INFJ personality like changing someone else’s life for the better."},{type:"description",text:"Many INFJs see helping others as their mission in life, and they’re always looking for ways to step in and speak up for what is right. At times, however, INFJs may focus so intently on their ideals that they don’t take adequate care of themselves – a pattern that can lead to stress and burnout."}]},{title:"Connecting with Others (and Themselves)",contentBlocks:[{type:"description",text:"INFJs value deep, authentic relationships with others. Few things bring these personalities as much joy as truly knowing another person – and being known in return. INFJs enjoy meaningful conversations far more than small talk, and they tend to communicate in a way that is warm and sensitive. This emotional honesty and insight can make a powerful impression on the people around them."},{type:"description",text:"Thoughtful and often selfless, INFJ personalities pour a great deal of energy and care into their relationships, but this doesn’t mean that they always feel appreciated in return. People with this personality type tend to slow down and really evaluate how what they do might impact others before they take action. Consequently, it can frustrate them when other people don’t recognize their good intentions. INFJs are very sensitive to criticism of any kind and can take things very personally."}]},{title:"A Personal Mission",contentBlocks:[{type:"description",text:"Many INFJ personalities feel that their life has a unique purpose – a mission that they were put onto this earth to fulfill. For them, one of the most rewarding aspects of life is seeking out this purpose – and then, once they’ve found it, striving to do it justice."},{type:"description",text:"When INFJs encounter inequity or unfairness, they rarely give up – instead, they consult their intuition and their compassion to find a solution. With their innate ability to balance the heart with the head, these dedicated types are hardwired to right the wrongs of the world, no matter how big or small. These personalities just need to remember that while they’re busy taking care of everyone else, they need to pause sometimes and take care of themselves as well."}]}]},INFP:{color:"#58a474",mainBody:{tags:["Introverted","Intuitive","Feeling","Prospecting"],title:"Mediator",type:"INFP",description:"Mediators are quiet, open-minded, and imaginative individuals who bring a caring and creative approach to everything they do."},content:[{title:"Introduction",contentBlocks:[{type:"description",text:"Although they may seem quiet or unassuming, people with the INFP personality type (Mediators) have vibrant, passionate inner lives. Creative and imaginative, they happily lose themselves in daydreams, inventing all sorts of stories and conversations in their mind. INFPs are known for their sensitivity – these personalities can have profound emotional responses to music, art, nature, and the people around them. They are known to be extremely sentimental and nostalgic, often holding onto special keepsakes and memorabilia that brighten their days and fill their heart with joy."},{type:"description",text:"Idealistic and empathetic, people with the INFP personality type long for deep, soulful relationships, and they feel called to help others. Due to the fast-paced and competitive nature of our society, they may sometimes feel lonely or invisible, adrift in a world that doesn’t seem to appreciate the traits that make them unique. Yet it is precisely because INFPs brim with such rich sensitivity and profound creativity that they possess the unique potential to connect deeply and initiate positive change."},{type:"quote",text:"All that is gold does not glitter; not all those who wander are lost; the old that is strong does not wither; deep roots are not reached by the frost.",author:"J. R. R. Tolkien"}]},{title:"The Gift of Empathy",contentBlocks:[{type:"description",text:"INFP personalities share a sincere curiosity about the depths of human nature. Introspective to the core, they’re exquisitely attuned to their own thoughts and feelings, but they yearn to understand the people around them as well. INFPs are compassionate and nonjudgmental, always willing to hear another person’s story. When someone opens up to them or turns to them for comfort, they feel honored to listen and be of help."},{type:"description",text:"Empathy is among the INFP personality type’s greatest gifts, but at times it can be a liability. The troubles of the world weigh heavily on their shoulders, and these personalities can be vulnerable to internalizing other people’s negative moods or mindsets. Unless they learn to set boundaries, INFPs may feel overwhelmed by just how many wrongs there are that need to be set right."}]},{title:"Speaking Their Truth",contentBlocks:[{type:"description",text:"Few things make INFP personalities more uneasy than pretending to be someone they aren’t. With their sensitivity and their commitment to authenticity, people with this personality type tend to crave opportunities for creative self-expression. It comes as no surprise, then, that many famous INFPs are poets, writers, actors, and artists. They can’t help but muse about the meaning and purpose of life, dreaming up all sorts of stories, ideas, and possibilities along the way."},{type:"description",text:"Through these imaginative landscapes, these soulful personalities can explore their own inner nature as well as their place in the world. While this is a beautiful trait, INFPs sometimes show a tendency to daydream and fantasize rather than take action. At times, these personalities may intensely deliberate with themselves in their heads, wrestling with their options until the last possible moment. To avoid feeling frustrated, unfulfilled, or incapable, INFPs need to make sure that they take decisive steps to turn their dreams and ideas into reality."}]},{title:"In Search of a Calling",contentBlocks:[{type:"description",text:"People with this personality type tend to feel directionless or stuck until they connect with a sense of purpose for their life. For many, this purpose has something to do with uplifting others. And while they want to help anyone and everyone, INFP personalities need to focus their energy and efforts – otherwise, they can end up exhausted."},{type:"description",text:"Fortunately, like flowers in the spring, an INFP’s creativity and idealism can bloom even after the darkest of seasons. Although they know the world will never be perfect, they still care about making it better however they can. This quiet belief in doing the right thing may explain why INFP personalities so often inspire compassion, kindness, and beauty wherever they go."}]}]},ISTP:{color:"#e4ae3a",mainBody:{tags:["Introverted","Observant","Thinking","Prospecting"],title:"Virtuoso",type:"ISTP",description:"Virtuosos are innovative and practical experimenters, masters of all kinds of tools."},content:[{title:"Introduction",contentBlocks:[{type:"quote",text:"I wanted to live the life, a different life. I didn’t want to go to the same place every day and see the same people and do the same job. I wanted interesting challenges.",author:"Harrison Ford"},{type:"description",text:"People with the ISTP personality type (Virtuosos) love to explore with their hands and their eyes, touching and examining the world around them with an impressive diligence, a casual curiosity, and a healthy dose of skepticism. They are natural makers, moving from project to project, building the useful and the superfluous for the fun of it and learning from their environment as they go. They find no greater joy than in getting their hands dirty pulling things apart and putting them back together, leaving them just a little bit better than they were before."},{type:"hr"},{type:"description",text:"ISTPs prefer to approach problems directly, seeking straightforward solutions over convoluted troubleshooting methods. People with this personality type rely heavily on firsthand experience and trial and error as they execute their ideas and projects. And as they do so, they usually prefer to work at their own pace, on their own terms, and without unnecessary interruptions."},{type:"description",text:"This is not a type who is inclined to socialize beyond what is necessary as they try to accomplish their goals. In fact, ISTP personalities generally find regular socializing to be taxing. And when they do decide to get together with people, they will almost always choose smaller, more meaningful interactions over superficial networking."}]},{title:"Direct & Decisive",contentBlocks:[{type:"description",text:"For all the mysteriousness heaped on them, with this type, what you see is what you get. Direct but reserved, calm but suddenly spontaneous, industrious but focused on their own priorities, people with the ISTP personality type can be a challenge to predict, even by their friends and loved ones. They can seem very steady for a while, but they tend to build up a store of impulsive energy that explodes without warning, taking their interests in bold new directions."},{type:"explanatory_note",text:"ISTPs act spontaneously on a new interest, exploring its viability after they’ve shifted gears."},{type:"description",text:"Decisions made by ISTPs may largely stem from their rational nature and their sense of what feels practical for them at any given moment, but that doesn’t mean that they don’t get swept away by their passions from time to time. Once their flame is lit, they tend to commit their time and energy with an impressive intensity until another equally compelling, or perhaps more gratifying, opportunity arises. And when it does, people with this personality type have no qualms about walking away from projects or situations that seem unfruitful or drained of potential."},{type:"description",text:"One of the biggest issues that they are likely to face is that, because they often act out of haste, they might rub people the wrong way sometimes. ISTPs are not the type to sugarcoat their opinions or feelings. They tend to have a very straightforward communication style that is often misinterpreted as bluntness or a lack of sensitivity, but it is simply the way these genuine souls operate. ISTP personalities have no time for people-pleasing or unnecessary social niceties. With them, there is little need to question their motives.."}]},{title:"Defying the Rules",contentBlocks:[{type:"description",text:"ISTP personalities are truly a unique bunch. At their core, they are authentic individuals who march to the beat of their own drum rather than adhering to societal norms and rules. Their opportunistic outlook and direct approach to life tend to create a rich tapestry of experiences and interactions for people with this personality type – some incredibly frustrating and others extremely gratifying."},{type:"description",text:"Guided by their knowledge and the evidence at their disposal, ISTPs navigate life by feel and inspiration, often stepping away from predefined routines to follow their instincts. They are unbound by convention, preferring to chart their own course in all that they do."},{type:"description",text:"In essence, people with the ISTP personality type live life freely on their own terms, valuing personal autonomy above most things. Weaving their way through social expectations, they still find a way to color outside the lines. Their journey might not align with broader norms, but therein lies the strength and beauty of their unique perspective. Finding an environment where they can coexist with people who understand their need for freedom, space, and unpredictability will give them many happy years."}]}]},ISTJ:{color:"#3894b7",mainBody:{tags:["Introverted","Observant","Thinking","Judging"],title:"Logistician",type:"ISTJ",description:"Logisticians are reserved yet willful individuals who carry out their actions with methodical purpose and a rational outlook on life."},content:[{title:"Introduction",contentBlocks:[{type:"quote",text:"I’d be more frightened by not using whatever abilities I’d been given. I’d be more frightened by procrastination and laziness.",author:"Denzel Washington"},{type:"description",text:"People with the ISTJ personality type (Logisticians) mean what they say and say what they mean, and when they commit to doing something, they make sure to follow through. With their responsible and dependable nature, it might not be so surprising that ISTJ personalities also tend to have a deep respect for structure and tradition."},{type:"description",text:"While ISTJs may not be particularly flashy or attention seeking, they do more than their share to keep society on a sturdy, stable foundation. In their families and their communities, people with this personality type often earn respect for their reliability, their practicality, and their ability to stay grounded and logical in even the most stressful situations."},{type:"explanatory_note",text:"True to their methodical nature, ISTJs often steer clear of impulsive behaviors, instead favoring careful deliberation when it comes to decision-making of any kind."}]},{title:"A Life of Integrity",contentBlocks:[{type:"description",text:"People with the ISTJ personality type believe that there is a right way to proceed in any situation – and that anyone who pretends otherwise is probably trying to bend the rules to suit their own desires. Consequently, they rarely hesitate to take responsibility for their actions and choices. They are quick to own up to their mistakes, admitting the truth even if it doesn’t make them look good or if it makes other people uncomfortable."},{type:"description",text:"To ISTJ personalities, honesty and straightforward communication are far more important than showmanship. They’d rather satisfy their own conscience than lie to impress someone else. In a world where many people shirk their responsibilities or say what they think others want to hear, ISTJs stand out as dedicated, responsible, and honest."},{type:"description",text:"ISTJ personalities are also known for striving to meet their obligations no matter what. However, they can sometimes unfairly misjudge people who don’t match their rigorous self-control, suspecting laziness or dishonesty when that person might actually be coping with other challenges."}]},{title:"Picking Up the Slack",contentBlocks:[{type:"description",text:"ISTJs’ dedication is an admirable quality, and it drives many of their accomplishments. But it can also become a weakness that other people take advantage of. With their strong work ethic and sense of duty, they may routinely find themselves shouldering other people’s responsibilities. Even if they don’t complain about the situation, ISTJ personalities can end up exhausted or discouraged if they’re constantly expected – or take it upon themselves – to pick up the slack for their colleagues, friends, or loved ones."},{type:"explanatory_note",text:"ISTJs may often find themselves doing others’ work – and not getting credit for it."},{type:"description",text:"ISTJ personalities aren’t known for expressing their emotions readily, but that doesn’t mean that they don’t feel frustration or resentment when they’re pulling more than their weight. By learning to set appropriate boundaries and speak up when they’re overstretched, ISTJs can ensure their relationships remain balanced and sustainable, allowing them to offer the full benefit of their clarity, loyalty, and dependability."}]}]},ISFJ:{color:"#3894b7",mainBody:{tags:["Introverted","Observant","Feeling","Judging"],title:"Defender",type:"ISFJ",description:"Defenders are warm, unassuming, and responsible individuals who give careful attention to practical details and excel in their altruism and loyalty."},content:[{title:"Introduction",contentBlocks:[{type:"quote",text:"Love only grows by sharing. You can only have more for yourself by giving it away to others.",author:"Brian Tracy"},{type:"description",text:"In their unassuming, understated way, people with the ISFJ personality type (Defenders) help make the world go round. Hardworking and devoted, these personalities feel a deep sense of responsibility to those around them. ISFJs can be counted on to meet deadlines, remember birthdays and special occasions, uphold traditions, and shower their loved ones with gestures of care and support."},{type:"description",text:"This is a capable, can-do personality type with a wealth of versatile gifts. Though sensitive and caring, ISFJs also have excellent analytical abilities and an eye for detail. And despite their reserve, they tend to have well-developed people skills and robust social relationships. These personalities are truly more than the sum of their parts, and their varied strengths shine in even the most ordinary aspects of their daily lives."},{type:"explanatory_note",text:"ISFJs are true altruists, meeting kindness with kindness-in-excess and engaging with the work and people they believe in with enthusiasm and generosity."}]},{title:"The Gift of Loyalty",contentBlocks:[{type:"description",text:"One of the greatest ISFJ strengths is loyalty. They rarely allow a friendship or relationship to fade away from lack of effort. Instead, they invest a great deal of energy into maintaining strong connections with their loved ones – and not just by sending “How are you doing?” texts. People with this personality type are known for dropping everything and lending a hand whenever a friend or family member is going through a hard time."},{type:"description",text:"ISFJ personalities tend to feel most energized and effective when they’re showing up for someone who needs their help. And their sense of loyalty doesn’t stop with their nearest and dearest – it often extends to their communities, their employers, and even family traditions. But the intensity of their commitment and desire to serve can have its downsides."},{type:"description",text:"Other people may take advantage of ISFJs’ helpful, hardworking nature, leaving them feeling burned out and overworked. A notable ISFJ weakness is that they often find change difficult – particularly when it’s sudden or involves unfamiliar territory. In fact, they are the most likely personality type to feel stressed out by last-minute changes."}]},{title:"The Highest of Standards",contentBlocks:[{type:"description",text:"For ISFJs, “good enough” is rarely good enough. People with this personality type can be meticulous to the point of perfectionism. They take their responsibilities seriously, consistently going above and beyond and doing everything that they can to exceed others’ expectations."},{type:"description",text:"Despite their hard work and consistency, ISFJ personalities are still known for their humility. They rarely seek the spotlight for the things they do. But that doesn’t mean that they are okay with being unnoticed or unappreciated. Unless they learn to stand up for themselves, ISFJs may find themselves quietly losing their enthusiasm and motivation."}]},{title:"Showing Up for Others – and Themselves",contentBlocks:[{type:"description",text:"Although they’re Introverted, ISFJ personalities have a deeply social nature. Thanks to their ability to remember the details of other people’s lives, they have a special talent for making their friends and acquaintances feel seen, known, and cherished."},{type:"description",text:"Dedicated and thoughtful, ISFJs find great joy in helping those around them build stable, secure, and happy lives. It may not be easy for people with this personality type to show up for themselves in the way that they show up for others, but when they do, they often find themselves with even more energy and motivation to do good in the world."}]}]},ISFP:{color:"#e4ae3a",mainBody:{tags:["Introverted","Observant","Feeling","Prospecting"],title:"Adventurer",type:"ISFP",description:"Adventurers are open-minded individuals with a grounded warmth. They approach life as a canvas for self-expression and uncover beauty in the present moment."},content:[{title:"Introduction",contentBlocks:[{type:"quote",text:"I change during the course of a day. I wake and I’m one person, and when I go to sleep I know for certain I’m somebody else.",author:"Bob Dylan"},{type:"description",text:"People with the ISFP personality type (Adventurers) are true artists – although not necessarily in the conventional sense. For these types, life itself is a canvas for self-expression. From what they wear to how they spend their free time, they act in ways that vividly reflect who they are as unique individuals."},{type:"description",text:"Driven by their sense of fairness and their open-mindedness, ISFPs move through life with an infectiously encouraging attitude. They love motivating those close to them to follow their passions and usually follow their own interests with the same unhindered enthusiasm."},{type:"explanatory_note",text:"Unassuming and humble, ISFPs often don’t realize how remarkable they really are."}]},{title:"The Beauty of an Open Mind",contentBlocks:[{type:"description",text:"These individuals embrace a flexible, adaptable approach to life. Some personalities thrive on strict schedules and routines – but not ISFPs. They prefer to take each day as it comes, doing what feels right to them in the moment."},{type:"description",text:"This flexible mindset makes ISFP personalities remarkably tolerant and nonjudgmental. They genuinely appreciate the diverse nature of the world, embracing people who may hold different opinions or practice unique lifestyles."},{type:"explanatory_note",text:"ISFPs want to live in a world where they – and everyone else – have the freedom to live as they see fit, without judgment."},{type:"description",text:"That said, their go-with-the-flow mentality can have its downsides. People with this personality type may struggle to set long-term plans – let alone stick with them. Adding a little structure to their lives can help them feel more capable and organized while maintaining their independence."}]},{title:"Living in Harmony",contentBlocks:[{type:"description",text:"In their relationships, ISFPs are warm, friendly, and caring, taking wholehearted enjoyment in the company of their nearest and dearest. But make no mistake: they need dedicated alone time to recharge their energy after socializing with others."},{type:"description",text:"Creative and free-spirited, ISFPs march to the beat of their own drum. However, they are also thoughtful and perceptive, able to pick up on people’s unspoken feelings and opinions. It can upset them if they don’t feel liked, approved of, or appreciated."},{type:"description",text:"Despite their sensitivity, ISFPs live in the present and focus on what’s right about life as it is. Everywhere they look, they find sources of beauty and enjoyment that others might miss – and this perspective is one of the many gifts they share with the world."}]}]},ESTJ:{color:"#3894b7",mainBody:{tags:["Extraverted","Observant","Thinking","Judging"],title:"Executive",type:"ESTJ",description:"Executives are stabilizing forces who value tradition, honesty, and dedication. They lead by example and excel at providing solid direction and structure."},content:[{title:"Introduction",contentBlocks:[{type:"quote",text:"Good order is the foundation of all things.",author:"Edmund Burke"},{type:"description",text:"People with the ESTJ personality type (Executives) are representatives of tradition and order, utilizing their understanding of what is right, wrong, and socially acceptable to bring families and communities together. Embracing the values of honesty and dedication, ESTJs are valued for their mentorship mindset and their ability to create and follow through on plans in a diligent and efficient manner."},{type:"description",text:"ESTJs are classic images of the model citizen: they help their neighbors, uphold the law, and try to make sure that everyone participates in the communities and organizations that they hold so dear."}]},{title:"Leading by Example",contentBlocks:[{type:"description",text:"Strong believers in the rule of law and authority that must be earned, ESTJ personalities lead by example, demonstrating dedication and purposeful honesty and an utter rejection of laziness and cheating. If anyone declares hard, manual work to be an excellent way to build character, it’s ESTJs."},{type:"description",text:"This personality type is aware of their surroundings and lives in a world of clear, verifiable facts. Their surety of their knowledge means that, even against heavy resistance, they stick to their principles and push an unclouded vision of what is and is not acceptable."},{type:"description",text:"People with the ESTJ personality type are dedicated individuals who pride themselves on always finishing what they start, rendering them reliable and trustworthy."},{type:"description",text:"However, ESTJs don’t work alone, and they expect their reliability and work ethic to be reciprocated. If their partner or coworkers jeopardize them through incompetence, laziness, or dishonesty, they do not hesitate to show their disappointment. This can earn them a reputation for inflexibility, but it’s rooted in their deep belief that these values are what make society work."}]},{title:"A Greater Responsibility",contentBlocks:[{type:"description",text:"The main challenge for ESTJ personalities is to recognize that not everyone follows the same path or contributes in the same way. A true leader recognizes the strength of the individual as well as that of the group and helps bring those individuals’ ideas to the table."},{type:"description",text:"By doing so, ESTJs can ensure that they really do have all the facts and are able to lead the charge in directions that work for everyone."}]}]},ESFJ:{color:"#3894b7",mainBody:{tags:["Extraverted","Observant","Feeling","Judging"],title:"Consul",type:"ESFJ",description:"Consuls are people-focused individuals who enjoy taking part in their social community. They are attentive, generous, and guided by strong values."},content:[{title:"Introduction",contentBlocks:[{type:"quote",text:"Encourage, lift, and strengthen one another. For the positive energy spread to one will be felt by us all.",author:"Deborah Day"},{type:"description",text:"For people with the ESFJ personality type (Consuls), life is sweetest when it’s shared with others. These social individuals form the bedrock of many communities, opening their homes – and their hearts – to friends, loved ones, and neighbors."},{type:"description",text:"ESFJs strongly believe in the power of hospitality and good manners, and they tend to feel a sense of duty to those around them. Generous and reliable, they often take it upon themselves – in ways both large and small – to hold their families and their communities together."},{type:"explanatory_note",text:"ESFJs have a talent for making the people in their lives feel supported, cared for, and secure."}]},{title:"The Beauty of a Responsible Life",contentBlocks:[{type:"description",text:"People with the ESFJ personality type are altruists. They take seriously their responsibility to give back, serve others, and do the right thing. They believe that there is a clear right thing to do in nearly every situation, and this often guides their decisions and actions."},{type:"description",text:"With their definite views on right and wrong, ESFJs tend to be on the opinionated side. However, their opinions are often based on a deep respect for tradition. ESFJs know that their actions affect others and trust that established norms and protocols will guide them to act considerately and responsibly."},{type:"description",text:"At times, ESFJs may struggle to accept when someone – especially someone they care about – disagrees with them or chooses a path they don’t understand. This can sometimes make it challenging for them to navigate differences in beliefs or behaviors."}]},{title:"Building Relationships That Last",contentBlocks:[{type:"description",text:"Supportive and outgoing, ESFJs can always be spotted at a party – ensuring that everyone is having a good time! But they don’t just breeze through other people’s lives. Loyal to the core, they build lasting relationships and can be counted on to show up whenever a helping hand or listening ear is needed."},{type:"description",text:"People with the ESFJ personality type rarely miss a birthday or holiday. Devoted to their relationships, they commit even the smallest details of their friends’ and loved ones’ lives to memory. Their love of order and structure means they prefer planned events and are happy to host to ensure everything goes smoothly."},{type:"description",text:"For many ESFJs, one of life’s greatest challenges is accepting that they can’t control anyone else’s thoughts or behavior – not even those closest to them. But by focusing on what they do best – setting an example of care, consideration, and responsibility – they can bring people together and find peace in the process."}]}]},ESTP:{color:"#e4ae3a",mainBody:{tags:["Extraverted","Observant","Thinking","Prospecting"],title:"Entrepreneur",type:"ESTP",description:"Entrepreneurs are energetic and action-oriented individuals who thrive on uncovering opportunities and diving into life’s challenges with enthusiasm and spontaneity."},content:[{title:"Introduction",contentBlocks:[{type:"quote",text:"Life is either a daring adventure or nothing at all.",author:"Helen Keller"},{type:"description",text:"People with the ESTP personality type (Entrepreneurs) are vibrant individuals brimming with enthusiastic and spontaneous energy. They tend to have a competitive mindset, assuming that competition is necessary for success. With their driven, action-oriented attitudes, ESTPs excel at staying focused on the present moment and rarely dwell on the past."},{type:"description",text:"Theory, abstract concepts, and lengthy discussions don’t hold ESTPs’ interest for long. They prefer energetic conversations and hands-on action, often leaping before they look and fixing mistakes as they go."}]},{title:"Diving Right In",contentBlocks:[{type:"description",text:"ESTPs are bold, brave, and unafraid to act on their impulses. They thrive on drama, passion, and stimulation, making quick decisions based on immediate reality. These personalities enjoy the excitement of living in the moment and approaching challenges with confidence."},{type:"description",text:"Traditional education and structured environments can be a challenge for ESTPs. While they are capable of excelling in these settings, the regimented approach doesn’t align with their preference for hands-on, experiential learning. Overcoming this hurdle often requires maturity and a focus on long-term goals."},{type:"description",text:"To ESTPs, rules are often seen as flexible, meant to be questioned or broken when necessary. While this can earn them a reputation for troublemaking, their energy and focus can be harnessed into becoming a powerful force when directed constructively."}]},{title:"The Path Less Traveled",contentBlocks:[{type:"description",text:"ESTPs have an exceptional ability to notice small changes and subtle details, such as shifts in facial expressions or habits. They use this skill immediately, often calling out observations and asking direct questions, even if it makes others uncomfortable."},{type:"description",text:"This instantaneous observation and action can be invaluable, particularly in fast-paced corporate environments or emergencies. ESTPs’ directness and quick thinking often position them as natural leaders in group settings."},{type:"description",text:"With their passion, energy, and rational minds, ESTPs inspire and lead others down paths less traveled, bringing excitement and vibrancy to any environment. However, their true challenge lies in channeling these qualities into constructive and rewarding pursuits."}]}]},ESFP:{color:"#e4ae3a",mainBody:{tags:["Extraverted","Observant","Feeling","Prospecting"],title:"Entertainer",type:"ESFP",description:"Entertainers are vibrant and energetic individuals who thrive on new experiences and connecting with others. They bring joy and spontaneity to every situation."},content:[{title:"Introduction",contentBlocks:[{type:"quote",text:"Live for each second without hesitation.",author:"Elton John"},{type:"description",text:"If anyone is to be found spontaneously breaking into song and dance, it is people with the ESFP personality type (Entertainers). They get caught up in the excitement of the moment and want everyone else to feel that way too. No other type is as generous with their time and energy when it comes to encouraging others, and no other type does it with such irresistible style."}]},{title:"Living with Passion",contentBlocks:[{type:"description",text:"ESFP personalities love being in the spotlight, not because they seek attention but because they have a natural knack for sensing what fits the moment. They enjoy entertaining others and making every gathering feel like a celebration."},{type:"description",text:"This personality type tends to have the strongest aesthetic sense of all, with an eye for fashion, style, and design. Whether it’s curating their outfits or decorating their spaces, ESFPs bring their unique flair to everything they touch."},{type:"description",text:"Though they love fun and drama, ESFPs are also deeply sensitive and attuned to others’ emotions. They are quick to offer emotional support or advice but may avoid conflict if the issue directly involves them."}]},{title:"A Spontaneous Spirit",contentBlocks:[{type:"description",text:"ESFPs often focus so much on immediate pleasures that they may neglect long-term responsibilities. They thrive on spontaneity but may struggle with tasks like budgeting, planning, or managing repetitive activities."},{type:"description",text:"While ESFPs recognize value and quality, their lack of planning can sometimes lead them to live beyond their means. Credit cards and financial planning can be tricky areas for these adventurous personalities."},{type:"explanatory_note",text:"ESFPs find nothing more frustrating than being unable to join their friends due to financial or circumstantial constraints."},{type:"description",text:"Despite their challenges, ESFPs bring laughter, energy, and excitement wherever they go. Their ability to uplift others makes them indispensable in any social setting. If they can learn to balance spontaneity with responsibility, they’ll continue to light up the world with their enthusiasm and charm."}]}]}})[e]||{};export{i};
